//ROLANDSC JOB (ACCT#),C-COMPILE,
// NOTIFY=&SYSUID,
// CLASS=A,
// MSGCLASS=X
//* PROC CBCCO COMPILE/PRELINK/GENERATE C-PROGRAMM_OBJECT'S
