//   PPARM='MAP,NOER',                    < PRE-LINKER OPTIONS
// OUTFILE='ROLANDS.GZIP.OBJ(GETOPT),DISP=SHR'
//COMPILE.ROLAND  DD  DISP=SHR,DSN=ROLANDS.GZIP.CNTL(COPTS)
//INFLATE EXEC PROC=CBCCO,INFILE=SBGOLOB.C418#23.FILE335(INFLATE),
//   CPARM='OPTFILE(DD:ROLAND)',    < COMPILER OPTIONS
//   PPARM='MAP,NOER',                    < PRE-LINKER OPTIONS
// OUTFILE='ROLANDS.GZIP.OBJ(INFLATE),DISP=SHR'
//COMPILE.ROLAND  DD  DISP=SHR,DSN=ROLANDS.GZIP.CNTL(COPTS)
//LZW    EXEC PROC=CBCCO,INFILE=SBGOLOB.C418#23.FILE335(LZW),
//   CPARM='OPTFILE(DD:ROLAND)',    < COMPILER OPTIONS
//   PPARM='MAP,NOER',                    < PRE-LINKER OPTIONS
// OUTFILE='ROLANDS.GZIP.OBJ(LZW),DISP=SHR'
//COMPILE.ROLAND  DD  DISP=SHR,DSN=ROLANDS.GZIP.CNTL(COPTS)
//TREES  EXEC PROC=CBCCO,INFILE=SBGOLOB.C418#23.FILE335(TREES),
//   CPARM='OPTFILE(DD:ROLAND)',    < COMPILER OPTIONS
//   PPARM='MAP,NOER',                    < PRE-LINKER OPTIONS
// OUTFILE='ROLANDS.GZIP.OBJ(TREES),DISP=SHR'
//COMPILE.ROLAND  DD  DISP=SHR,DSN=ROLANDS.GZIP.CNTL(COPTS)
//UNLZH  EXEC PROC=CBCCO,INFILE=SBGOLOB.C418#23.FILE335(UNLZH),
//   CPARM='OPTFILE(DD:ROLAND)',    < COMPILER OPTIONS
//   PPARM='MAP,NOER',                    < PRE-LINKER OPTIONS
// OUTFILE='ROLANDS.GZIP.OBJ(UNLZH),DISP=SHR'
//COMPILE.ROLAND  DD  DISP=SHR,DSN=ROLANDS.GZIP.CNTL(COPTS)
//UNLZW  EXEC PROC=CBCCO,INFILE=SBGOLOB.C418#23.FILE335(UNLZW),
//   CPARM='OPTFILE(DD:ROLAND)',    < COMPILER OPTIONS
//   PPARM='MAP,NOER',                    < PRE-LINKER OPTIONS
// OUTFILE='ROLANDS.GZIP.OBJ(UNLZW),DISP=SHR'
//COMPILE.ROLAND  DD  DISP=SHR,DSN=ROLANDS.GZIP.CNTL(COPTS)
//UNPACK EXEC PROC=CBCCO,INFILE=SBGOLOB.C418#23.FILE335(UNPACK),
//   CPARM='OPTFILE(DD:ROLAND)',    < COMPILER OPTIONS
//   PPARM='MAP,NOER',                    < PRE-LINKER OPTIONS
// OUTFILE='ROLANDS.GZIP.OBJ(UNPACK),DISP=SHR'
//COMPILE.ROLAND  DD  DISP=SHR,DSN=ROLANDS.GZIP.CNTL(COPTS)
//UNZIP  EXEC PROC=CBCCO,INFILE=SBGOLOB.C418#23.FILE335(UNZIP),
//   CPARM='OPTFILE(DD:ROLAND)',    < COMPILER OPTIONS
//   PPARM='MAP,NOER',                    < PRE-LINKER OPTIONS
// OUTFILE='ROLANDS.GZIP.OBJ(UNZIP),DISP=SHR'
//COMPILE.ROLAND  DD  DISP=SHR,DSN=ROLANDS.GZIP.CNTL(COPTS)
//UTIL   EXEC PROC=CBCCO,INFILE=SBGOLOB.C418#23.FILE335(UTIL),
//   CPARM='OPTFILE(DD:ROLAND)',    < COMPILER OPTIONS
//   PPARM='MAP,NOER',                    < PRE-LINKER OPTIONS
// OUTFILE='ROLANDS.GZIP.OBJ(UTIL),DISP=SHR'
//COMPILE.ROLAND  DD  DISP=SHR,DSN=ROLANDS.GZIP.CNTL(COPTS)
//ZIP    EXEC PROC=CBCCO,INFILE=SBGOLOB.C418#23.FILE335(ZIP),
//   CPARM='OPTFILE(DD:ROLAND)',    < COMPILER OPTIONS
//   PPARM='MAP,NOER',                    < PRE-LINKER OPTIONS
// OUTFILE='ROLANDS.GZIP.OBJ(ZIP),DISP=SHR'
//COMPILE.ROLAND  DD  DISP=SHR,DSN=ROLANDS.GZIP.CNTL(COPTS)
//* NOW THE EXECUTABLE
//COMP  EXEC PROC=CBCCL,INFILE=SBGOLOB.C418#23.FILE335(GZIP),
//   CPARM='OPTFILE(DD:ROLAND)',    < COMPILER OPTIONS
//   PPARM='MAP,NOER',                    < PRE-LINKER OPTIONS
//   LPARM='AMODE=31,MAP,RENT',           < LINKAGE EDITOR OPTIONS
// OUTFILE='ROLANDS.GZIP.LOAD(GZIP),DISP=SHR'
//COMPILE.ROLAND  DD  DISP=SHR,DSN=ROLANDS.GZIP.CNTL(COPTS)
//PLKED.SYSLIB DD
//             DD DISP=SHR,DSN=ROLANDS.GZIP.OBJ
//PLKED.SYSIN2 DD  *
INCLUDE  SYSLIB(C370,GZIP,ZIP,DEFLATE,TREES,BITS,UNZIP,INFLATE)
